import sys

def reverse(s):
	DNA=list(s)
	DNA.reverse()
	return(''.join(DNA))

def complementary(s):
	d={'A':'T','C':'G','G':'C','T':'A'}
	letter=list(s)
	letter=(d[base]for base in letter)
	return (''.join(letter))


DNA=''
reverseDNA=reverse(DNA)
complementartreverseDNA=complementary(reverseDNA)
print(complementartreverseDNA)
